import React from 'react';
import './App.css';
import ChatBot from 'react-simple-chatbot';

const steps = [
    {
      id: '0',
      message: 'Welcome to react chatbot!',
      trigger: '1',
    },
    {
      id: '1',
      message: 'Bye!',
      end: true,
    },
  ];

function Chat(){
    return(
        <ChatBot steps={steps} />
    )
}

export default Chat;
